                c = '\n    <h2>抖音立减活动细则</h2><br>\n    <h3>活动时间</h3>\n    2025年6月1日-12月31日，每日09:00-24:00<br>\n    <h3>活动内容</h3>\n    客户在抖音App内进行抖音团购下单时，选择抖音支付绑定商丘工行信用卡即有机会享受满20随机立减2-10元的优惠，同一客户每月最多可享受2次优惠，每日限1次。每日名额有限，先到先得，享完即止！\n    <h3>其他说明</h3>\n    （一）<span style="font-weight: bold">本活动对象为在商丘地区办理的工行信用卡客户，且<span style="color: red">下单时定位要在商丘</span></span>。\n    <br>（二）同一用户指同一个登录帐号、同一个设备、同一个手机号、同一个身份证号等与用户身份相关的信息，其中任意一项或数项存在相同、相似、通过特定标记形成批量信息、或其他非真实有效等情形的，经排查认定多个帐号的实际控制人为同一人的，均将被认定为同一用户，按活动规则中的同一用户处理。\n    <br>（三）参与活动的用户，如使用优惠的交易发生全额退款，在活动名额充足的情况下，用户在活动期间内仍可尝试再次参与本活动。如发生部分退款，优惠金额不退，且退款后本次交易享受的所有优惠权益视为已被消耗。\n    <br>（四）本活动优惠与平台优惠及其他活动优惠不可同时享受，系统将根据用户支付方式默认为用户选择当笔订单可享受的抖音支付最大优惠权益，以页面显示为准。\n    <br>（五）用户所购买的商品均由抖音小店商家提供，商品物流及售后由相应商家负责，商品购买相关流程与规则均以电商平台规则为准。用户对商品有疑问的，请与商家沟通解决。\n    <br>（六）抖音支付有权对用户订单进行审核，如抖音支付认定订单存在异常（包括任何形式的用户作弊行为），有权限制抖音支付银行卡立减权益的享受。\n    <br>（七）若参与活动的客户存在通过不正当手段获取不当利益或有碍其他客户公平参加活动或有违活动举办目的的行为，工行有权取消该客户活动参与资格，或追回该客户通过参加活动所获权益优惠。\n    <br>（八）若对活动有任何疑问，可拨打服务电话：4000-112-580(周一至周五9:00-18:00，法定节假日除外)。\n',
                s = '\n    <h2>美团立减活动细则</h2><br>\n    <h3>活动时间</h3>\n    2025年6月1日-12月31日，每日09:00-24:00<br>\n    <h3>活动对象</h3>\n    商丘工行信用卡个人客户\n    <h3>活动内容</h3>\n    客户在“美团APP-外卖/团购，或美团外卖APP内”场景下单，选择“普通支付-美团支付-商丘地区工行信用卡”支付满20元，即有机会享受随机立减2-10元的优惠。同一客户每月最多可享受2次优惠，每日限1次。每日名额有限，先到先得，享完即止！\n    <h3>其他说明</h3>\n    1、如您在美团未提前绑定商丘地区工行信用卡，则可在“普通支付-美团支付-切换月付、其他银行卡等支付-支付方式下”选择添加活动银行卡，添加成功后亦可享受活动优惠。\n    <br>2、<span style="color: red">客户下单城市、商户所在城市必须在商丘地区，且客户必须开启美团定位授权，</span>如未向美团开通地理位置授权，则此类客户将始终不可享受优惠。授权存在15分钟的缓存，美团以缓存期间获悉的地理位置为准。\n    <br>3、在支付时商丘地区工行信用卡显示优惠提示，如有优惠再继续支付，若无则表示优惠名额用完。\n    <br>4、若您的美团账户里有美团平台或者其他活动发的优惠券或立减优惠，则在支付时收银台会择优调取优惠，具体优惠金额以收银台显示优惠金额为准。若前面几笔均未使用到本活动优惠，则需要在美团平台或者其他活动发的优惠券或立减优惠用完后，方可享受本活动优惠。此规则由美团官方定义！\n    <br>5、若享受立减优惠的订单发生全额退款，仅退还用户实际支付的金额（不包含优惠金额）。若订单部分退款，立减金额会按比例扣除。退款后优惠名额不退回。\n    <br>6、同一美团账号、同一手机号、同一银行卡、同一身份证、同一设备等符合其中一项即视为同一客户\n    <br>7、若因用户自身原因（如支付失败、订单超时未支付等）导致无法享受立减优惠，后续不予补发。\n    <br>8、若客户存在通过不正当手段获取不当利益或有其他客户公平参加活动或有违活动举办目的的记录或行为，我行有权取消该客户活动参与资格或取消、追回该客户通过参加活动所获奖品或权益。\n    <br>9、若对活动有任何疑问，可拨打服务电话4000-112-580（工作日9:00-12:00/14:00-18:00)\n',
